import React from 'react'

const GoogleMap = () => {
    return (
        <div className="google-map-area section text-center section-padding-bottom">
            <div className="container">
                <div className="contact-map-area" data-aos="fade-up">
                    <iframe className="contact-map" src="https://www.google.com/maps/embed/v1/place?q=place_id:EjAxIFNhbnNvbWUgU3QgIzM1dGgsIFNhbiBGcmFuY2lzY28sIENBIDk0MTA0LCBVU0EiOho4CjASLgoUChIJ7fJfbWKAhYARrKXCgfUWxaMQASoUChIJ0yAzZvWAhYARVl3_X6zVs_4SBDM1dGg&key=..."  aria-hidden="false"></iframe>
                </div>
            </div>
        </div>
    )
}

export default GoogleMap;
